sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

var req=inputs.requestBody;
req.product.productName=inputs.prodName;
req.product.variant=inputs.variantName;
req.product.productId=inputs.prodID;
if(req.product.coverDetails){
req.product.coverDetails.mainCoverValue=inputs.variantCode;
}
else{

var obj={
    mainCoverValue:inputs.variantCode
}
req.product.coverDetails=obj;
}
if(!req.product.frequency)
req.product.frequency="Yearly";

if(!req.product.multiplier){
    req.product.multiplier=10;
}   

outputs.request=req;

})(inputs, outputs);

